import axios from 'axios'
import getAuthorizationHeader from './auth-header';




const URL_API = 'http://localhost:8080/api/pets/';

const user = AuthService.getToken;



const get = (id: string) => {
    return axios.get(URL_API + id, {headers: getAuthorizationHeader()})
};

// eslint-disable-next-line import/no-anonymous-default-export
export default {
    get
  };
